  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;Measurements of energetic neutral
  atoms (ENAs) are a new tool to improve our understanding of energy release and particle
  acceleration in solar eruptive events. &amp;nbsp;Due to limitations of past observations,
  even the most basic questions remain unanswered about the acceleration of solar
  energetic particles (SEPs) by shocks driven by coronal mass ejections (CMEs). &amp;nbsp;ENAs
  provide the only way to observe SEPs where they are accelerated. &amp;nbsp;The one
  observation of solar ENAs to date had low sensitivity, a high energy threshold,
  and no imaging information. The Solar Energetic Neutral-atom Imaging Coronagraph
  (SENIC) instrument concept is designed to observe ENAs from &amp;lt;~20 keV to a
  few hundred keV with a spectral resolution as good as 1 keV and image them from
  2 R_sun to 40 R_sun with a spatial resolution of 0.1 R_sun. &amp;nbsp;Since ENAs
  cannot be imaged with focusing optics, this concept uses an indirect imaging technique
  similar to the one successfully used on RHESSI. &amp;nbsp;Thus, the SENIC instrument
  concept&amp;nbsp;combines large detector area, a low energy threshold, and high
  angular resolution.&lt;br /&gt;&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\": \"U.S.
